	[25003] = {
		heroId = 25003,heroName = "莎莉丝特",model = 25003,trueFive = 1,uniqueWeapon = -1,heroStar = 5,category = 2,attType = 1,professional = 1,protext = "战士",characterization = "职业:战士<br>物理伤害<br>单体，爆发",quality = {{attr="残血收割",color="0Xe18ba8",},{attr="吸收伤害",color="0X69b6f1",},{attr="协助吸血",color="0X98a2eb",},},description = "    莎莉丝特是军团长旗下的一名强将，被众多人所尊敬;但她的出身几乎很少人知道。据说她不是纯魔族之人，在她有意识以来深受同种族人的歧视。因此在八岁那年，独自一人来到了位于潘地曼尼南的边缘地带不起眼的城镇——卡曼科斯，在卡曼科斯可以让她自由自在地活着，在这里她至少不会受到别人异样的眼光看待；她起誓总有一天可以将卡曼变得繁荣，不再有难以容忍的罪恶事件发生。<br>    在她渐渐熟悉卡曼斯科时候，她遇见了来卡曼历练的罗素，这是她人生中最大的转折点，也因此改变了她所有的想法。<br>    跟着罗素来到了隶属公会下的箱庭，不久后公会内<br>乱，箱庭并不想参与公会的内乱中，但同时需要有人给他们收取情报，让他们的弊端减少到最低，而罗素的师父也就是箱庭的长老把莎莉丝特推出去，因她不属于任何一派，正是最好的人选……<br> <br>  “我最大的幸运是箱庭，但我最不幸的也来自箱庭。”",pointId = 2,baseHp = 729,baseDam = 234,baseDef = 143,baseMagdam = 23,baseMagdef = 125,baseSpeed = 62,kHp = 72.94,kDam = 23.45,kDef = 14.38,kMagdam = 2.35,kMagdef = 12.5,kSpeed = 6.25,skill1 = {2500321,2500322,2500323,},skill2 = {2500311,2500312,2500313,},skill3 = {2500331,2500332,2500333,},skill4 = {2500341,2500342,2500343,},triggerSkill = {2500334,},passiveSkill = {105,117,112,114,102,101,104,108,120,},activeNum = 0,stageRate0 = 1,stageRate1 = 1.013,stageRate2 = 1.063,stageRate3 = 1.113,stageRate4 = 1.195,stageRate5 = 1.385,stageRate6 = 1.64,stageRate7 = 2.09,stageRate8 = 2.64,stageRate9 = 3.62,stageRate10 = 4.8,stageRate11 = 5.5,stageRate12 = 5.5,starRule = 4,collegePoint = 500,suggestpassive = 1,recompoint = {4,3,2,0,1,0,},suggestEmblem = {1,3,5,},exhibit = 1,isGet = 1,tip1 = "你好弱啊，探长！",tip2 = "尔等的自尊就在我面前粉碎吧！",tip3 = "我便让尔等仰望一下强者的高度吧。",sound = {20015,20016,40008,},sound2 = {30008,40008,},heroNumber = 27,drawer = "瓜皮cyyyyy",cver = ""
