	[45001] = {
		heroId = 45001,heroName = "太白",model = 45001,trueFive = 1,uniqueWeapon = 15,heroStar = 5,category = 4,attType = 1,professional = 1,protext = "战士",characterization = "职业:战士<br>物理伤害<br>单体，爆发",quality = {{attr="爆发点杀",color="0Xe18ba8",},{attr="格挡",color="0X69b6f1",},},description = "    吉格酒馆的幕后老板，一个与世无争的人，潇洒自在地过生活才是他的王道。<br>    在他心血来潮期间开了吉格，但是又不自己亲自管理。在别人看来他是因为情伤而买醉，为了能免费喝酒而自己开了酒馆……但其实他最大的心愿是让那些“受伤”的人有一个无忧无虑的世外桃源。<br>    在吉格建立后，太白让他的好友墨香给自己打理整个吉格，但墨香想要在吉格收集一些小道消息；同时为了能让各贵族给吉格让路，答应他们在酒馆内开设匿名委托。起初太白极其反对，但墨香成功说服了他……<br>    太白把吉格全部交给墨香后，自己在各地间游历，鲜少人能发现他的行踪。<br>    在吉格成立十年后，唯一一次在吉格酒馆长待，遇上了女伯爵伊丽莎白，并以酒会友……<br><br>    “世界上什么地方才是人们心中的世外桃源呢？是酒吗？”",pointId = 1,baseHp = 500,baseDam = 200,baseDef = 115,baseMagdam = 20,baseMagdef = 100,baseSpeed = 50,kHp = 50,kDam = 20,kDef = 11.5,kMagdam = 2,kMagdef = 10,kSpeed = 5,skill1 = {4500121,4500122,4500123,},skill2 = {4500111,4500112,4500113,},skill3 = {4500131,4500132,4500133,},skill4 = {4500141,4500142,4500143,},triggerSkill = {4500151,},passiveSkill = {105,117,112,114,102,101,104,108,120,},activeNum = 0,stageRate0 = 1,stageRate1 = 1.013,stageRate2 = 1.063,stageRate3 = 1.113,stageRate4 = 1.195,stageRate5 = 1.385,stageRate6 = 1.64,stageRate7 = 2.09,stageRate8 = 2.64,stageRate9 = 3.62,stageRate10 = 4.8,stageRate11 = 5.5,stageRate12 = 5.5,starRule = 1,collegePoint = 500,suggestpassive = 1,recompoint = {3,4,1,0,1,1,},suggestEmblem = {3,4,5,},exhibit = 1,isGet = 1,tip1 = "想哭的话，我可以借肩膀给你。",tip2 = "前锋的位置可以让我来。",tip3 = "写诗和喝酒是人生最大的乐趣。",sound = {20087,20088,40044,},sound2 = {40044,20088,},heroNumber = 5,drawer = "ETMecheall",cver = ""
